import axios from "axios";
import auth_header from "./auth_header";

export const activeLinks = async () => {
  return axios
      .get('http://localhost:3600/admin/invite/',{ headers: await auth_header() })
      .then((response) => {
        return response.data;
      });
};

export const inviteUser = async (inviteData) => {
  return axios
      .post('http://localhost:3600/admin/invite/', inviteData, { headers: await auth_header() })
      .then((response) => {
        return response.data;
      });
};
